	<script >
		$(document).ready(function() {
			$('#basic-datatables').DataTable({
			});

			$('#multi-filter-select').DataTable( {
				"pageLength": 5,
				initComplete: function () {
					this.api().columns().every( function () {
						var column = this;
						var select = $('<select class="form-control"><option value=""></option></select>')
						.appendTo( $(column.footer()).empty() )
						.on( 'change', function () {
							var val = $.fn.dataTable.util.escapeRegex(
								$(this).val()
								);

							column
							.search( val ? '^'+val+'$' : '', true, false )
							.draw();
						} );

						column.data().unique().sort().each( function ( d, j ) {
							select.append( '<option value="'+d+'">'+d+'</option>' )
						} );
					} );
				}
			});

			// Add Row
			$('#add-row').DataTable({
				"pageLength": 5,
			});

			var action = '<td> <div class="form-button-action"> <button type="button" data-toggle="tooltip" title="" class="btn btn-link btn-primary btn-lg" data-original-title="Edit Task"> <i class="fa fa-edit"></i> </button> <button type="button" data-toggle="tooltip" title="" class="btn btn-link btn-danger" data-original-title="Remove"> <i class="fa fa-times"></i> </button> </div> </td>';

			$('#addRowButton').click(function() {
				$('#add-row').dataTable().fnAddData([
					$("#addName").val(),
					$("#addPosition").val(),
					$("#addOffice").val(),
					action
					]);
				$('#addRowModal').modal('hide');

			});
		});
	</script>

	<script type="text/javascript">
		$(document).ready(function(){
			
			$(".close").on("click",function(){
				$("#alertModel").modal("hide");
			});
			
			$(".occu_unoccupied").on("click",function(){

			$("#loaderModel").modal("show");
			$("#loaderModel").unbind("click");
			let target = $(this);
			let text_check = target.text();
			let table_id = target.data("id");
			let status = target.attr("status");
			

			/*ajax calling*/

				var data = {
	            '_token': "{{csrf_token()}}",
	            'table_id': table_id,
	            'status' : status
	            };

	          	$.ajax({
	              url:"{{url('restaurant/occupied-unoccupied')}}",
	              type:'POST',
	              data:data,
	              success: function(res){
	              	setTimeout(function(){

	              		console.log(res);
		              	if(res.status == 2){
		              		target.text("Unoccupied");
		              		target.attr('status',"1");
		              		$("#alert_txt").text("Table has been update occupied to Unoccupied successfully.");
		              	}else{
		              		target.text("Occupied");
		              		target.attr('status',"2");
		              		$("#alert_txt").text("Table has been update Unoccupied to Occupied successfully.");
		              	}
		              	$("#loaderModel").modal("hide");
		              	$("#alertModel").modal("show");
		              	$("#alertModel").unbind("click");
	              	},500);
	                
	              },
	              error: function(data, textStatus, xhr) {
	                if(data.status == 422){
	                  var result = data.responseJSON;
	                  alert('Something went worng.');
	                  window.location.href = "";
	                  return false;
	                } 
	              }
	            });
          	});
		});
	</script>

